import React, { Component } from 'react';
import CardMenu from './CardMenu.js';

class MenuGallery extends Component {
   constructor(props){
    super(props);
    this.state = {
      menuIndex: 0,
      menuID: false,
      menuInnerID: false
    }

    this.showMilkshakeMenu = this.showMilkshakeMenu.bind(this);
    this.showWrafflesMenu = this.showWrafflesMenu.bind(this);
  }

  showMilkshakeMenu(){
    this.setState({
      menuID: "show-menu-card",
      menuInnerID:"show-menu-card-inner"
    })
    console.log('milkshakes is clicked');

  }

  showWrafflesMenu() {
    console.log('wraffles is clicked');

  }

  render() {
    return (
      <div>
        <div className="row">
          <div className="col-6 gallery-image gallery-image-left" >
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title" onClick={this.showMilkshakeMenu}>Milkshakes</p>
          </div>
          <div className="col-6 gallery-image gallery-image-right" onClick={this.showWrafflesMenu}>
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title">Wraffles</p>
          </div>
        </div>

        <div className="row">
          <div className="col-12 gallery-image gallery-image-large">
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title menu-gallery-title-large">Våfflor</p>
          </div>
        </div>

        <div className="row">
          <div className="col-6 gallery-image gallery-image-left">
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title">Dryck</p>
          </div>
          <div className="col-6 gallery-image gallery-image-right">
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title">Bakverk</p>
          </div>
        </div>



      </div>

      )
  }
}

export default MenuGallery;
